import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../styles/Dashboard.css';
import logo from '../assets/Poly-Agent_logo.jpeg';

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    // Load user data from localStorage
    const userData = localStorage.getItem('user');
    if (userData) {
      setUser(JSON.parse(userData));
    }

    // Check if user is authenticated by making a request to the profile endpoint
    const checkAuth = async () => {
      try {
        const response = await fetch('/api/users/profile/', {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
          },
          credentials: 'include',
        });

        if (response.ok) {
          const data = await response.json();
          setUser(data);
          localStorage.setItem('user', JSON.stringify(data));
        } else {
          // If not authenticated, redirect to login
          navigate('/login');
        }
      } catch (err) {
        console.error('Authentication check failed:', err);
        setError('Failed to verify authentication. Please try again.');
      } finally {
        setIsLoading(false);
      }
    };

    checkAuth();
  }, [navigate]);

  const handleLogout = async () => {
    try {
      await fetch('/api/users/logout/', {
        method: 'POST',
        credentials: 'include',
      });

      // Clear local storage and state
      localStorage.removeItem('user');
      setUser(null);

      // Redirect to login page
      navigate('/login');
    } catch (err) {
      console.error('Logout failed:', err);
      setError('Failed to logout. Please try again.');
    }
  };

  if (isLoading) {
    return (
      <div className="loading-container">
        <div className="spinner large"></div>
        <p>Loading dashboard...</p>
      </div>
    );
  }

  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <div className="header-left">
          <img src={logo} alt="Poly-Agent Logo" className="dashboard-logo" />
          <h1>Poly-Agent Dashboard</h1>
        </div>
        <div className="header-right">
          <nav className="dashboard-nav">
            <Link to="/dashboard" className="nav-link active">Dashboard</Link>
            <Link to="/health-checks" className="nav-link">Health Checks</Link>
            <Link to="/profile" className="nav-link">Profile</Link>
          </nav>
          {user && (
            <div className="user-info">
              <span>Welcome, {user.name || user.username}</span>
              <button className="logout-btn" onClick={handleLogout}>Logout</button>
            </div>
          )}
        </div>
      </header>

      {error && <div className="dashboard-error">{error}</div>}

      <main className="dashboard-content">
        <div className="dashboard-welcome">
          <h2>Welcome to Your Dashboard</h2>
          <p>Monitor your applications and analyze your data all in one place.</p>
        </div>

        <div className="dashboard-cards">
          <div className="dashboard-card">
            <h3>Health Monitoring</h3>
            <p>Monitor your application health and performance with real-time alerts.</p>
            <div className="card-footer">
              <Link to="/health-checks" className="card-btn">View Health Checks</Link>
            </div>
          </div>

          <div className="dashboard-card">
            <h3>GitHub Integration</h3>
            <p>Connect your GitHub account to monitor repositories and contributions.</p>
            <div className="card-footer">
              <button className="card-btn">Connect GitHub</button>
            </div>
          </div>

          <div className="dashboard-card">
            <h3>User Profile</h3>
            <p>Manage your account settings and personal information.</p>
            <div className="card-footer">
              <Link to="/profile" className="card-btn">View Profile</Link>
            </div>
          </div>
        </div>
      </main>

      <footer className="dashboard-footer">
        <p>&copy; {new Date().getFullYear()} Poly-Agent. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Dashboard;
